import { initializeApp } from "firebase/app";
import {getStorage, ref, uploadBytes} from "firebase/storage";

const firebaseConfig = {
  apiKey: "AIzaSyDGaDuV1k-1iwweYGwIabLXKpnyny7kCpg",
  authDomain: "uveats-upload-file.firebaseapp.com",
  projectId: "uveats-upload-file",
  storageBucket: "uveats-upload-file.appspot.com",
  messagingSenderId: "88589869501",
  appId: "1:88589869501:web:bbf2172b04380c597f32d4",
  measurementId: "G-FLSW5RX027"
};

const app = initializeApp(firebaseConfig);

export const storage = getStorage(app);

export function uploadFile(file){
